import React from 'react';
import {
  Box,
  Typography,
  Paper,
  Grid,
  TextField,
  InputAdornment,
  Divider,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from '@mui/material';

const ValuationMetrics = ({ formik }) => {
  // Helper function to calculate cap rate
  const calculateCapRate = () => {
    const noi = parseFloat(formik.values.netOperatingIncome || 0);
    const propertyValue = parseFloat(formik.values.estimatedValue || 0);
    if (propertyValue === 0) return 'N/A';
    return ((noi / propertyValue) * 100).toFixed(2) + '%';
  };

  // Helper function to calculate price per square foot
  const calculatePricePerSF = () => {
    const propertyValue = parseFloat(formik.values.estimatedValue || 0);
    const buildingSize = parseFloat(formik.values.buildingSize || 0);
    if (buildingSize === 0) return 'N/A';
    return '$' + (propertyValue / buildingSize).toFixed(2);
  };

  // Helper function to calculate gross rent multiplier
  const calculateGRM = () => {
    const propertyValue = parseFloat(formik.values.estimatedValue || 0);
    const potentialGrossIncome = parseFloat(formik.values.potentialGrossIncome || 0);
    if (potentialGrossIncome === 0) return 'N/A';
    return (propertyValue / potentialGrossIncome).toFixed(2) + 'x';
  };

  // Helper function to format currency
  const formatCurrency = (value) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      minimumFractionDigits: 0,
      maximumFractionDigits: 0
    }).format(value);
  };

  return (
    <Paper elevation={3} sx={{ p: 3 }}>
      <Typography variant="h5" gutterBottom>
        Valuation Metrics
      </Typography>
      <Typography variant="body2" paragraph>
        Review and adjust key valuation metrics for the property.
      </Typography>

      <Grid container spacing={3}>
        {/* Current Property Metrics */}
        <Grid item xs={12}>
          <Typography variant="h6" gutterBottom>
            Current Property Metrics
          </Typography>
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="estimatedValue"
            name="estimatedValue"
            label="Estimated Property Value"
            type="number"
            InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
            value={formik.values.estimatedValue || ''}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="valuationDate"
            name="valuationDate"
            label="Valuation Date"
            type="date"
            InputLabelProps={{ shrink: true }}
            value={formik.values.valuationDate || ''}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="valuePerSquareFoot"
            label="Value Per Square Foot"
            InputProps={{ readOnly: true }}
            value={calculatePricePerSF()}
          />
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="capRate"
            label="Capitalization Rate"
            InputProps={{ readOnly: true }}
            value={calculateCapRate()}
          />
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="grossRentMultiplier"
            label="Gross Rent Multiplier"
            InputProps={{ readOnly: true }}
            value={calculateGRM()}
          />
        </Grid>

        {/* Discounted Cash Flow Metrics */}
        <Grid item xs={12}>
          <Divider sx={{ my: 2 }} />
          <Typography variant="h6" gutterBottom>
            Discounted Cash Flow Analysis
          </Typography>
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="discountRate"
            name="discountRate"
            label="Discount Rate (%)"
            type="number"
            InputProps={{ 
              endAdornment: <InputAdornment position="end">%</InputAdornment>,
              inputProps: { min: 0, max: 30, step: 0.1 }
            }}
            value={formik.values.discountRate || '8.0'}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="terminalCapRate"
            name="terminalCapRate"
            label="Terminal Cap Rate (%)"
            type="number"
            InputProps={{ 
              endAdornment: <InputAdornment position="end">%</InputAdornment>,
              inputProps: { min: 0, max: 30, step: 0.1 }
            }}
            value={formik.values.terminalCapRate || '7.5'}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="holdingPeriod"
            name="holdingPeriod"
            label="Holding Period (Years)"
            type="number"
            InputProps={{ inputProps: { min: 1, max: 30, step: 1 } }}
            value={formik.values.holdingPeriod || '10'}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            id="annualIncomeGrowth"
            name="annualIncomeGrowth"
            label="Annual Income Growth (%)"
            type="number"
            InputProps={{ 
              endAdornment: <InputAdornment position="end">%</InputAdornment>,
              inputProps: { min: 0, max: 20, step: 0.1 }
            }}
            value={formik.values.annualIncomeGrowth || '3.0'}
            onChange={formik.handleChange}
          />
        </Grid>

        {/* Market Comparables Summary */}
        <Grid item xs={12}>
          <Divider sx={{ my: 2 }} />
          <Typography variant="h6" gutterBottom>
            Market Comparables Summary
          </Typography>
        </Grid>

        <Grid item xs={12}>
          <TableContainer>
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Metric</TableCell>
                  <TableCell align="right">Subject Property</TableCell>
                  <TableCell align="right">Market Low</TableCell>
                  <TableCell align="right">Market Average</TableCell>
                  <TableCell align="right">Market High</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                <TableRow>
                  <TableCell>Price Per SF</TableCell>
                  <TableCell align="right">{calculatePricePerSF()}</TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.pricePSF.low"
                      name="marketMetrics.pricePSF.low"
                      value={formik.values.marketMetrics?.pricePSF?.low || ''}
                      onChange={formik.handleChange}
                      InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.pricePSF.average"
                      name="marketMetrics.pricePSF.average"
                      value={formik.values.marketMetrics?.pricePSF?.average || ''}
                      onChange={formik.handleChange}
                      InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.pricePSF.high"
                      name="marketMetrics.pricePSF.high"
                      value={formik.values.marketMetrics?.pricePSF?.high || ''}
                      onChange={formik.handleChange}
                      InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
                    />
                  </TableCell>
                </TableRow>
                <TableRow>
                  <TableCell>Cap Rate</TableCell>
                  <TableCell align="right">{calculateCapRate()}</TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.capRate.low"
                      name="marketMetrics.capRate.low"
                      value={formik.values.marketMetrics?.capRate?.low || ''}
                      onChange={formik.handleChange}
                      InputProps={{ endAdornment: <InputAdornment position="end">%</InputAdornment> }}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.capRate.average"
                      name="marketMetrics.capRate.average"
                      value={formik.values.marketMetrics?.capRate?.average || ''}
                      onChange={formik.handleChange}
                      InputProps={{ endAdornment: <InputAdornment position="end">%</InputAdornment> }}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.capRate.high"
                      name="marketMetrics.capRate.high"
                      value={formik.values.marketMetrics?.capRate?.high || ''}
                      onChange={formik.handleChange}
                      InputProps={{ endAdornment: <InputAdornment position="end">%</InputAdornment> }}
                    />
                  </TableCell>
                </TableRow>
                <TableRow>
                  <TableCell>Gross Rent Multiplier</TableCell>
                  <TableCell align="right">{calculateGRM()}</TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.grm.low"
                      name="marketMetrics.grm.low"
                      value={formik.values.marketMetrics?.grm?.low || ''}
                      onChange={formik.handleChange}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.grm.average"
                      name="marketMetrics.grm.average"
                      value={formik.values.marketMetrics?.grm?.average || ''}
                      onChange={formik.handleChange}
                    />
                  </TableCell>
                  <TableCell align="right">
                    <TextField 
                      size="small" 
                      id="marketMetrics.grm.high"
                      name="marketMetrics.grm.high"
                      value={formik.values.marketMetrics?.grm?.high || ''}
                      onChange={formik.handleChange}
                    />
                  </TableCell>
                </TableRow>
              </TableBody>
            </Table>
          </TableContainer>
        </Grid>

        <Grid item xs={12}>
          <Divider sx={{ my: 2 }} />
          <Typography variant="h6" gutterBottom>
            Valuation Methods
          </Typography>
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="valuationMethods.incomeApproach"
            name="valuationMethods.incomeApproach"
            label="Income Approach Value"
            type="number"
            InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
            value={formik.values.valuationMethods?.incomeApproach || ''}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="valuationMethods.salesComparison"
            name="valuationMethods.salesComparison"
            label="Sales Comparison Value"
            type="number"
            InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
            value={formik.values.valuationMethods?.salesComparison || ''}
            onChange={formik.handleChange}
          />
        </Grid>

        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            id="valuationMethods.costApproach"
            name="valuationMethods.costApproach"
            label="Cost Approach Value"
            type="number"
            InputProps={{ startAdornment: <InputAdornment position="start">$</InputAdornment> }}
            value={formik.values.valuationMethods?.costApproach || ''}
            onChange={formik.handleChange}
          />
        </Grid>

        {/* Valuation Comments */}
        <Grid item xs={12}>
          <TextField
            fullWidth
            id="valuationNotes"
            name="valuationNotes"
            label="Valuation Notes"
            multiline
            rows={3}
            value={formik.values.valuationNotes || ''}
            onChange={formik.handleChange}
          />
        </Grid>
      </Grid>
    </Paper>
  );
};

export default ValuationMetrics;
